import {Link} from 'react-router-dom';
import Avatar from '@mui/material/Avatar';
import Button from '@mui/material/Button';
import CssBaseline from '@mui/material/CssBaseline';
import TextField from '@mui/material/TextField';
import Grid from '@mui/material/Grid';
import Box from '@mui/material/Box';
import LockOutlinedIcon from '@mui/icons-material/LockOutlined';
import Typography from '@mui/material/Typography';
import Container from '@mui/material/Container';
import { createTheme, ThemeProvider } from '@mui/material/styles';
import { socketcontext } from "../context/socket";
import { useRef, useCallback, useState, useEffect, useContext, React} from "react";

function Copyright(props) {
  return (
    <Typography variant="body2" color="text.secondary" align="center" {...props}>
    </Typography>
  );
}

const theme = createTheme();

export default function SignUp() {
  const socket = useContext(socketcontext);
  const [ws, setws] = useState(null);
  const [msg, setmsg] = useState(null);

  const connectws = () =>{
    setws(socket);
  }

  useEffect(() => {
    if(ws){
      console.log('success connect!');
      initwebsocket()
    }
  // eslint-disable-next-line react-hooks/exhaustive-deps
  }, [ws]);

  const initwebsocket = () => {
    ws.on('connect', function(){
      ws.emit('connet_event', 'connected to server');
    })
    ws.emit('signup_event', msg);
  }

  const handleSubmit = (event) => {
    event.preventDefault();
    const data = new FormData(event.currentTarget);
    // eslint-disable-next-line no-console
    console.log({
      email: data.get('signup_email'),
      username: data.get('signup_username'),
      password: data.get('signup_password'),
    });
    setmsg({email: data.get('signup_email'), username: data.get('signup_username'), password: data.get('signup_password')});
    connectws();
  };

  return (
    <ThemeProvider theme={theme}>
      <Container component="main" maxWidth="xs">
        <CssBaseline />
        <Box
          sx={{
            marginTop: 8,
            display: 'flex',
            flexDirection: 'column',
            alignItems: 'center',
          }}
        >
          <Avatar sx={{ m: 1, bgcolor: 'secondary.main' }}>     {/*for img */}
            <LockOutlinedIcon />
          </Avatar>
          <Typography component="h1" variant="h5">
            註冊
          </Typography>
          <Box component="form" onSubmit={handleSubmit} sx={{ mt: 3 }}>
            <Grid container spacing={2}>
              <Grid item xs={12}>
                <TextField
                  required
                  fullWidth
                  id="signup_email"
                  label="電子郵件"
                  name="email"
                  autoComplete="email" // eslint-disable-next-line
                  inputProps={{ pattern: "[a-z0-9._%+-]+@[a-z0-9.-]+\.[a-z]{2,4}$" }}   
                  placeholder='請輸入電子郵件'
                />
              </Grid>
              <Grid item xs={12}>
                <TextField
                required
                fullWidth
                name="username"
                label="使用者名稱"
                type="username"
                id="signup_username"
                autoComplete="current-password"
                />
              </Grid>
              <Grid item xs={12}>
                <TextField
                  required
                  fullWidth
                  name="password"
                  label="密碼"
                  type="password"
                  id="signup_password"
                  autoComplete="new-password"
                />
              </Grid>
              <Grid item xs={12}>
              </Grid>
            </Grid>
            <Button
              type="submit"
              fullWidth
              variant="contained"
              sx={{ mt: 3, mb: 2 }}
            >
              註冊
            </Button>
            <Grid container justifyContent="flex-end">
              <Grid item>
                <Link 
                component = {Link}
                to = '/signin'>
                    已經擁有帳戶了嗎?從這裡登入
                </Link>
              </Grid>
            </Grid>
          </Box>
        </Box>
        <Copyright sx={{ mt: 5 }} />
      </Container>
    </ThemeProvider>
  );
}
